import React, { Fragment } from "react";
import {
    AppBar,
    Toolbar,
    Typography,
    makeStyles,
    Button,
    ThemeProvider
} from "@material-ui/core/";
import themeNav from "../../config/themeNav";

const useStyle = makeStyles((theme) => ({
    offset: {
        ...theme.mixins.toolbar,
        marginBoton: "1rem",
    },
    title: {
        flexGrow: 1,
        color: "#FFF"
    },
}));

const Navbar = () => {
    const classes = useStyle();
    return (
        <ThemeProvider theme = {themeNav}>
            <AppBar position="fixed" color="primary">
                <Toolbar>

                    <Typography variant="h6" color="light" className={classes.title}>
                        Nhamommarandu
                    </Typography>
                    <Button variant="text" color="light">
                        Primary
                    </Button>
                </Toolbar>
            </AppBar>
            <div className={classes.offset}></div>
        </ThemeProvider>
    );
};

export default Navbar;
